# Implementing a function to compare two strings and show the differences if they don't match
def compare_strings(str1, str2):
    if str1 == str2:
        return "The strings match."
    
    differences = []
    len1, len2 = len(str1), len(str2)
    min_len = min(len1, len2)
    
    for i in range(min_len):
        if str1[i] != str2[i]:
            differences.append(f"Difference at index {i}: {str1[i]} != {str2[i]}")
            
    if len1 != len2:
        if len1 > len2:
            differences.append(f"Extra characters in the first string: {str1[min_len:]}")
        else:
            differences.append(f"Extra characters in the second string: {str2[min_len:]}")
            
    return differences

